import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'; // Make sure you import 'Routes'
import Home from './components/home';
import Tracking from "./components/"
function App() {


  return (
    <Router>
      <Routes> {/* Use <Routes> for routing */}
        <Route path="/" element={<Home />} />
        <Route path="/tracking" element={<Tracking />} />
      </Routes>
    </Router>

  );

}

export default App;
